	(1, '3130113001', '琅悦上海静安会所', '琅悦静安', '310000', '310100', '310106', '上海市静安区西康路572号', 121.452109, 31.230180, '021-31608679', '13334334333', NULL, '创立于2005年，坐落于静安区西康路昌平路口，地处上海市中心黄金地段，地理位置得天独厚，交通极其便利。采用国际月子会所独栋楼宇的设计理念，闹中取静，是产妇修养身心的绝佳选择。会所环境奢华大气，细节之处独具一格，套房尊贵舒适，安全私密。', '周一至周日 全天', '00030001', NULL, NULL, '00660002', NULL, NULL, NULL, 0, 68000, 3.0000, 5.0000, '2017-09-21 15:20:32', 'U001', '2017-09-21 15:20:40', 'U001', 0, 0, NULL, NULL, NULL, '00790001', 1, '2017-12-01 00:00:00', '2099-12-01 00:00:00', 1),
	(2, '3130117001', '琅悦花木会所', '琅悦花木', '310000', '310100', '310115', '上海浦东新区梅花路1108号18楼(上海卓美亚喜玛拉雅酒店)', 121.561816, 31.210225, '31661153', '13818001092', '201204', '琅悦花木会所坐落于浦东超五星级大酒店上海卓美亚喜玛拉雅酒店内，18楼整层行政楼层，每间房间都是行政套房，设有独立空调、中央新风和空气净化系统，杜绝PM2.5对妈妈和宝宝的危害。', '周一至周日 全天', '00030001', NULL, NULL, '00660002', NULL, NULL, NULL, 0, 68000, 3.0000, 5.0000, '2017-12-22 11:08:17', 'admin', '2017-12-22 11:46:07', 'admin', 0, 3, NULL, '', '', '00790001', 1, '2017-12-01 00:00:00', '2099-12-01 00:00:00', 1),
	(3, '3130318001', '悦悦满陆家嘴VIP会所', '悦悦满陆家嘴', '310000', '310100', '310115', '浦东新区乳山路231号', 121.526210, 31.237289, '', '15026921909', '200120', '悦悦满陆家嘴VIP会所创立于2010年，坐落于浦东新区乳山路靠近福山路、地处梅园公园对面，空气清新，地理位置优越，交通便利，独栋楼宇，静享私密。聘请专业设计团队按照星级精品酒店标准进行设计和建造，三重顶级安防体系确保每位妈妈和宝宝的安全私密，会所走廊顶层全透明玻璃装饰，让宝宝足不出户也能晒太阳。大厅环境典雅，简约大气，尊享大空间的卧房，舒适自在，内部设施齐全，房间内人体工学宽体大床，环保家具，进口电器，独立空调，独立新风系统，美国怡口净水系统和中央饮水系统一应俱全，是产妇理想月子生活的不二之选。', '周一至周日 全天', '00030003', NULL, NULL, '00660002', NULL, NULL, NULL, 0, 48000, 3.0000, 5.0000, '2018-01-10 10:10:44', 'admin', '2018-01-12 11:08:55', NULL, 0, 2, NULL, '', '', '00790001', 1, '2017-12-01 00:00:00', '2099-12-01 00:00:00', 1),
	(4, '3410118001', '琅悦会所北京香格里拉店', '琅悦北香', '110000', '110100', '110108', '北京市海淀区紫竹院路29号香格里拉饭店景阁17层', 116.460315, 39.914164, '', '13426183208', '', '琅悅月子會所入駐於北京香格里拉酒店17層，位於北京市海淀區紫竹院路29號，會所保留香格里拉五星級的奢華品質，設計師針對安全、衛生以及私密的需求進行定制化改造，在保留原香格里拉酒店五星級的奢華品質之余更用心在細節處打磨，全心為產婦和嬰兒提供舒心的服務體驗。', '周一至周日（9:00-18:00）', '00030001', NULL, NULL, '00660002', NULL, NULL, NULL, 0, 75800, 3.0000, 5.0000, '2018-01-23 14:15:07', 'admin', '2018-01-25 12:31:17', NULL, 0, 2, NULL, '', '', '00790001', 1, '2017-12-01 00:00:00', '2099-12-01 00:00:00', 1),
	(5, 'BABYSKYGROUP', '贝瑞佳集团', '贝瑞佳集团', '0', '0', '0', '南京路592号12楼', 0.000000, 0.000000, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, '00660002', NULL, NULL, NULL, 1, NULL, NULL, NULL, '2018-01-23 16:03:35', 'root', NULL, NULL, 0, 0, NULL, NULL, NULL, '00790002', 0, '2017-12-01 00:00:00', '2099-12-01 00:00:00', 1),
	(6, '3420218001', '天津贝瑞佳南开会所', '贝瑞佳天津南开', '120000', '120100', '120104', '南京路海光寺338号金泽大酒店25楼贝瑞佳接待处', 117.176720, 39.123401, '', '18522312886', '', '贝瑞佳国际月子会所创办于2010年，是全国最大的专业连锁产后母婴护理机构，而天津会所是以高星级及专业母婴护理标准设施进行配备的，位于市中心高端地带，邻近天津市中心妇幼医院，修养环境静谧悠然，地理位置优越，交通便利。客房玻璃门禁体系确保每位妈妈和宝宝的安全私密，尊享大空间的卧房，舒适自在，内部设施齐全，房间独立弹簧大床，环保家具，进口电器，独立空调，独立新风系统，美国怡口净水系统和中央饮水系统一应俱全，是产妇理想月子生活的不二之选。', '周一至周日（8:00-19:00）', '00030002', NULL, NULL, '00660001', NULL, NULL, NULL, 0, 39800, 3.0000, 5.0000, '2018-01-29 10:26:04', 'admin', '2018-01-29 10:26:04', NULL, 0, 1, NULL, '', '', '00790001', 1, '2018-01-29 10:26:15', '2099-12-01 00:00:00', 1),
	(7, '3140218001', '杭州上城贝瑞佳母婴服务有限公司', '贝瑞佳杭州上城', '330000', '330100', '330102', '杭州市上城区望江东路鲲鹏路363号捷特漫大酒店四楼', 120.196790, 30.228099, '0571-86586633', '0571-86586633', '', '贝瑞佳月子会所坐落于杭州市上城区望江东路捷特漫大酒店4层，东临钱塘江，北倚南宋御街、河坊街，坐享城市中心优势资源，闹中取静。距离杭州城站火车站仅16分钟车程，近地铁，交通十分便利。会所环境优美，静谧舒适，整体采用欧式装饰风格，中西合璧，时尚现代，处处尽显尊华。江景房即可将钱塘江的美丽风景尽收眼底，是杭州市唯一花园式月子会所，受到杭州上万妈妈的推崇和信赖。', '周一至周日（8:00-19:00）', '00030002', NULL, NULL, '00660002', NULL, NULL, NULL, 0, 58800, 3.0000, 5.0000, '2018-02-13 10:12:22', 'admin', '2018-02-13 10:12:33', NULL, 0, 2, NULL, '', '', '00790001', 1, '2018-02-13 15:07:24', '2099-12-01 00:00:00', 1),
